import React, { useState, useEffect } from 'react';

const Hero = () => {
  const titles = ['Web Developer', 'IT Student', 'Problem Solver', 'Tech Enthusiast'];
  const [currentTitleIndex, setCurrentTitleIndex] = useState(0);
  const [isAnimating, setIsAnimating] = useState(false);

  useEffect(() => {
    const interval = setInterval(() => {
      setIsAnimating(true);
      setTimeout(() => {
        setCurrentTitleIndex(prev => (prev + 1) % titles.length);
        setIsAnimating(false);
      }, 500);
    }, 3000);

    return () => clearInterval(interval);
  }, [titles.length]);

  const scrollToSection = (sectionId) => {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <section id="hero" className="hero-section">
      <div className="hero-bg-pattern"></div>
      <div className="container">
        <div className="hero-content">
          <div className="hero-text">
            <span className="hero-greeting">Hello, I'm</span>
            <h1 className="hero-name">Carl Luis</h1>
            <h2 className={`hero-title ${isAnimating ? 'fade-out' : ''}`}>
              {titles[currentTitleIndex]}
            </h2>
            <p className="hero-intro">
              Passionate about creating beautiful, functional, and user-friendly 
              digital experiences. Currently pursuing IT at Cavite State University - Silang Campus.
            </p>
            <div className="hero-cta">
              <button 
                className="cta-button primary"
                onClick={() => scrollToSection('projects')}
              >
                <span>View Projects</span>
                <i className="fas fa-arrow-right"></i>
              </button>
              <button 
                className="cta-button secondary"
                onClick={() => scrollToSection('about')}
              >
                <span>About Me</span>
              </button>
            </div>
            <div className="hero-stats">
              <div className="stat-item">
                <span className="stat-number">3+</span>
                <span className="stat-label">Projects</span>
              </div>
              <div className="stat-item">
                <span className="stat-number">2</span>
                <span className="stat-label">Certifications</span>
              </div>
              <div className="stat-item">
                <span className="stat-number">3rd</span>
                <span className="stat-label">Year Student</span>
              </div>
            </div>
          </div>
          <div className="hero-image-wrapper">
            <div className="hero-image-container">
              <img src="/img/profile.jpg" alt="Carl Luis C. Dimapilis" className="profile-image" />
              <div className="image-decoration"></div>
            </div>
          </div>
        </div>
      </div>
      <div className="scroll-indicator" onClick={() => scrollToSection('about')}>
        <span>Scroll</span>
        <i className="fas fa-chevron-down"></i>
      </div>
    </section>
  );
};

export default Hero;
